(1405, 1, 7, 'Ultraboost 5.0', 4725000, 4250000, 'The primary materials that compose this product contain a minimum of 20 percent recycled content.', 'Navy', '2023-12-25 04:46:52', '2023-12-25 04:46:52'),
(1406, 1, 26, 'Addiction 14', 3250000, 1975000, 'The easy support and roomier fit of the BrooksÂ® Addiction 14 sneakers give you the control, comfort, and impact protection you need to keep you steady on both short and long runs. ', 'Black', '2023-12-25 04:46:52', '2023-12-25 04:46:52'),
(1407, 1, 8, 'Tedric', 1600000, 1375000, 'No matter if you hit the courts or the streets, the Tommy HilfigerÂ® Tedric is designed to offer you an exceptional level of cushioning, breathability, and lightweight performance so that you can make every move with ease and comfort.', 'White', '2023-12-25 04:46:52', '2023-12-25 04:46:52'),
(1408, 1, 7, 'Ultraboost DNA X Disney', 4500000, 3850000, 'The adidasÂ® UltraBOOST DNA X DisneyÂ® sneaker is designed with a sock-like fit that targets support where it\'s needed most. The full-length Boost midsole enables a responsive energy return in between strides, while significantly reducing shock from harsh i', 'Black', '2023-12-25 04:46:52', '2023-12-25 04:46:52'),
(1409, 1, 18, 'Hovr Infinite 5', 3000000, 2150000, 'Engineered spacer mesh upper.', 'Black', '2023-12-25 04:46:52', '2023-12-25 04:46:52'),
(1410, 1, 62, 'Listy', 2125000, 1225000, 'Maintain ultimate comfort while staying in style with the GUESSÂ® Listy sneakers. ', 'Gray', '2023-12-25 04:46:52', '2023-12-25 04:46:52'),
(1411, 1, 28, 'Skate Eraâ¢', 1750000, 1300000, 'The all new Skate Eraâ¢ lace-up shoes by Vansâ¢ offer a completely revamped with an tenacious new inside specifically for modern skateboarding!', 'Black', '2023-12-25 04:46:52', '2023-12-25 04:46:52'),
(1412, 1, 17, 'Reagan Lace-Up Sneaker', 2500000, 1675000, 'Polish off your handsome style wearing the Cole HaanÂ® Reagan Lace-Up Sneaker. ', 'Navy', '2023-12-25 04:46:52', '2023-12-25 04:46:52'),
(1413, 1, 13, 'Total Motion Court Plain Toe', 3000000, 2525000, 'Offering a tailored look, the RockportÂ® Total Motion Court Plain Toe Sneakers come with a simple and elegant design.', 'Black', '2023-12-25 04:46:52', '2023-12-25 04:46:52'),
(1414, 1, 7, 'Alphabounce+', 2225000, 2225000, 'Keep yourself going throughout the day by wearing adidasÂ® Running Alphabounce+ footwear.', 'Silver', '2023-12-25 04:46:52', '2023-12-25 04:46:52'),
(1415, 1, 288, 'Nautilus', 875000, 650000, 'Stay stylish in comfort when you\'re staying active in the Body GloveÂ® Nautilus sneakers.', 'Black', '2023-12-25 04:46:52', '2023-12-25 04:46:52'),
(1416, 1, 8, 'Tedric', 1600000, 1600000, 'No matter if you hit the courts or the streets, the Tommy HilfigerÂ® Tedric is designed to offer you an exceptional level of cushioning, breathability, and lightweight performance so that you can make every move with ease and comfort.', 'Green', '2023-12-25 04:46:52', '2023-12-25 04:46:52'),
(1417, 1, 50, 'Cure Casual High-Top Skate Shoes Sneakers', 1750000, 1475000, 'COMFORT: The lightweight, padded tongue and collar provide added comfort and support to your feet; Ventilation holes help your feet breathe while on the move at the skatepark, or on the way to class, work, or to hangout with friends.', 'Black', '2023-12-25 04:46:52', '2023-12-25 04:46:52'),
(1418, 1, 8, 'Realist', 1875000, 1200000, 'The  Tommy HilfigerÂ® Realist will add a clean and colorful look to your modern style.', 'White', '2023-12-25 04:46:52', '2023-12-25 04:46:52'),
(1419, 1, 13, 'Total Motion Court T-Toe', 3000000, 2025000, 'Experience the ultimate comfort wearing the classic RockportÂ® Total Motion Court T-Toe Oxfords that offers a smooth stride at every step.', 'Black', '2023-12-25 04:46:52', '2023-12-25 04:46:52'),
(1420, 1, 7, 'Nizza', 1625000, 1150000, 'A reissue of the classic trainer from \'78, the adidasÂ® Nizza shoes keep it real with clean canvas uppers and rubber toe bumper. ', 'Black', '2023-12-25 04:46:52', '2023-12-25 04:46:52'),
(1421, 1, 28, 'Old Skool Platform', 1875000, 1625000, 'Keep your style on point with the eye-catching VansÂ® Old Skool Platform shoes!', 'Black', '2023-12-25 04:46:52', '2023-12-25 04:46:52'),
(1422, 1, 157, 'Longwood Sneaker', 2750000, 1700000, 'Pair the Polo Ralph LaurenÂ® Longwood lace-up sneaker with a relaxed polo and khaki shorts for the ultimate summertime look. Perforated leather upper features logo details throughout, a round toe, and treaded rubber outsole.', 'Navy', '2023-12-25 04:46:52', '2023-12-25 04:46:52'),
